svg.script:

window.onload = function() {
	const chatLog = document.getElementById("chatLog");
	const project = document.getElementById("project");
	let translateY = 0;
	let timer;
	let restartCycleTimer;
	let play = true;

	function resetCycle() {
		chatLog.classList.remove("animating");
		translateY = 0;
		chatLog.style = "";
		const bubbleGroups = document.querySelectorAll(".bubbleGroup.visible");
		bubbleGroups.forEach(bubbleGroup => {
			bubbleGroup.classList.remove("visible");
			const bubble = bubbleGroup.querySelector(".bubble");
			bubble.style = "";
		});

		const trigger = project;
	}

	function restartCycle() {
		resetCycle();
		restartCycleTimer = window.setTimeout(() => {
			chatLog.classList.add("animating");
			playCycle();
		}, (50));
	}

	function playCycle() {
		if (!play) return;

		const bubbleGroup = document.querySelector(".bubbleGroup:not(.visible)");
		if (!bubbleGroup) {
			restartCycle();
			return;
		}
		const bubble = bubbleGroup.querySelector(".bubble");
		const changeY = parseInt(bubbleGroup.querySelector(".dimensions").getAttribute("height"), 10);
		const chatLogTransitionDuration = changeY * 8;
		translateY = translateY - changeY;
		chatLog.style.transitionDuration = `${chatLogTransitionDuration}ms`;
		chatLog.style.transform = `translateY(${translateY}px)`;

		// transition-property: opacity, transform;
		bubble.style.transitionDelay = `${chatLogTransitionDuration / 1.5}ms, ${chatLogTransitionDuration / 1.5}ms`;
		bubbleGroup.classList.add("visible");
		timer = window.setTimeout(() => {
			playCycle();
		}, (chatLogTransitionDuration + 1500));
	}
	playCycle();

	document.addEventListener("visibilitychange", () => {
		if (document.visibilityState === "visible") {
			restartCycleTimer = window.setTimeout(() => {
				chatLog.classList.add("animating");
				play = true;
				playCycle();
			}, (50));
		} else {
			play = false;
			clearTimeout(timer);
			clearTimeout(restartCycleTimer);
			resetCycle();
		}
	});
};
